import React from "react";
import Coinprice from "./CoinPrice";
import TwentyFourHourHigh from "./TwentyFourHourHigh";
import TwentyFourHourLow from "./TwentyFourHourLow ";
import Circulating from "./Circulating";
import DescriptionText from "./DescriptionText";
import Image from "./Image";
import Rank from "./Rank";
import Symbol from "./Symbol";

const CoinDescription = (props) => {
  return (
    <>
      <Coinprice coinprice={props.coinPrice} />
      <Desc24hrHigh desc24hrhigh={props.desc24HrHigh} />
      <Desc24hrLow desc24hrlow={props.desc24HrLow} />
      <DescCirculating desccirculating={props.descCirculating} />
      <DescDescription descdescription={props.descDescription} />
      <DescImage descimage={props.descImage} />
      <DescMarketCap descmarketcap={props.descMarketCap} />
      <DescName descname={props.descName} />
      <DescRank descrank={props.descRank} />
      <DescSymbol descsymbol={props.descSymbol} />
    </>
  );
};

export default CoinDescription;
